package main

/*
- LeetCode - https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii/
- TimeComplexity - O(n)
- SpaceComplexity - O(n)
*/

type runeFrequency struct {
	runeStr rune
	count   int
}

type runeStack []runeFrequency

func (s *runeStack) pop() runeFrequency {
	out := (*s)[len(*s)-1]
	*s = (*s)[:len(*s)-1]
	return out
}

func (s *runeStack) peek() runeFrequency {
	return (*s)[len(*s)-1]
}

func (s *runeStack) push(str runeFrequency) {
	*s = append(*s, str)
}

func (s runeStack) isEmpty() bool {
	return len(s) == 0
}

func removeDuplicates(s string, k int) string {

	remainingStack := new(runeStack)

	for _, v := range s {

		if remainingStack.isEmpty() {
			remainingStack.push(runeFrequency{v, 1})
		} else {

			i := 0

			for i < k-1 {

				if !remainingStack.isEmpty() && remainingStack.peek().runeStr == v {
					i += remainingStack.pop().count
				} else {
					break
				}
			}

			if i != k-1 {
				remainingStack.push(runeFrequency{v, i + 1})
			}
		}
	}

	reverseStack := new(runeStack)
	out := []rune{}

	for !remainingStack.isEmpty() {
		reverseStack.push(remainingStack.pop())
	}

	for !reverseStack.isEmpty() {

		elem := reverseStack.pop()

		for i := 0; i < elem.count; i++ {
			out = append(out, elem.runeStr)
		}

	}

	return string(out)
}

